/* 笔的端点
** 画图：
** 连接端点，画折线；如果coiling_data.status == 1，最后一笔画实线，否则画虚线；
** 笔的颜色：实线的颜色是JKStyle.chanPenColor，虚线的颜色是JKStyle.chanDashPenColor；
** 笔的线宽：1
*/
function readPoints(candlesticks, coilingData)
{
    // coilingPoints的元素值，表示k线的索引
    const coilingPoints = coilingData.points;
    var isTop = coilingData.istop;
    return coilingPoints.map(index => {
        const point = {
            'index': index, // k线索引
            'price': isTop ? candlesticks[index][3] : candlesticks[index][4] // 最高价或最低价
        };
        isTop = !isTop; // 切换 isTop
        return point;
    });
}

/* 中枢
** 画图：
** 如果中枢方向=1，称为向上中枢，否则称为向下中枢；
** 以(起始时间,底)作为左下角，(终止时间,顶)作为右上角，画矩形；
** 中枢的颜色：<br />
** 如果是向上中枢，段数小于等于7，颜色是rgba(0,176,80,0.5)，
** 如果是向上中枢，段数大于7，颜色是rgba(162,255,52)；
** 如果是向下中枢，段数小于等于7，颜色是rgba(254,24,24,0.5)，
** 如果是向下中枢，段数大于7，颜色是rgba(254,44,244,0.5)
** 画中枢标记：
** 标记的位置：(起始时间,顶-30)；<br />
** 标记的内容：标记由'-'或'+'符号，大写字母，平方号（段数大于等于9时）按顺序组成；<br />
** 如果是向上中枢，则取'+'号，否则取'-'号；如果序号是1，则字母是A，序号是2，字母是B，序号是3，字母是C，以此类推；如果段数大于等于9，则含有平方号；<br />
** 标记的颜色：<br />
** 如果是向上中枢，段数小于等于7，颜色是rgba(0,176,80)，<br />
** 如果是向上中枢，段数大于7，颜色是rgba(162,255,52)；<br />
** 如果是向下中枢，段数小于等于7，颜色是rgba(254,24,24)，<br />
** 如果是向下中枢，段数大于7，颜色是rgba(254,44,244)；<br />
** 标记的字体：SimHei；<br />
** 标记的字体大小：24
*/
function readPivots(coilingData, points)
{
    const coilingPivots = coilingData.pivots;

    return coilingPivots.map(item => {
        // 中枢的起始位置，points索引
        const start = Number(item[0]);
        // 中枢的结束位置，points索引
        const end = Number(item[1]);
        // 中枢的顶，points索引
        const top = Number(item[2]);
        // 中枢的底，points索引
        const bottom = Number(item[3]);
        // 中枢方向（向上或向下）
        const direction = Number(item[4]);
        // 中枢结束方向，1为正向结束，-1为反向结束
        const positive = Number(item[5]);
        // 中枢标记
        const mark = Number(item[6]); 

        return pivot = {
            'start': points[start].index,   // 中枢起始位置，k线索引
            'end': points[end].index,       // 中枢结束位置，k线索引
            'top': points[top].price,       // 中枢顶部的价格
            'bottom': points[bottom].price, // 中枢底部的价格
            'segmentNum': end - start,      // 中枢段数（中枢包含了多少笔）
            'direction': direction,
            'positive': positive,
            'mark': mark
        }
    });
}

