// 海底捞月
function hdly(candlesticks)
{
    if (candlesticks.length < 2) return [];

    const n = 3;
    const m = 1;
    let i, k;
    let PRE_LOW;
    let LOW;
    let SMA_1 = 0;
    let SMA_2 = 0;
    let VAR2 = 0;
    let EMA_1 = 0;
    let VAR3 = EMA_1;
    let VAR5 = VAR3;
    let VAR7;
    let EMA_2 = VAR3 / 2 + VAR5;
    const length = candlesticks.length;
    VAR3_arr = new Array(length).fill(0.0); 
    VAR7_arr = new Array(length).fill(0.0); 
    VAR3_arr[0] = VAR3;
    VAR7_arr[0] = EMA_2 /618;

    for (i = 1; i < length; ++i) {
        /* 昨日最低 */
        PRE_LOW = candlesticks[i - 1][4];
        LOW = candlesticks[i][4];
        /* 最低价减去昨日低价的绝对值的3日S移动平均 */
        SMA_1 = Math.abs(LOW - PRE_LOW) * m / n + SMA_1 * (n - m) / n;
        /* 最低价减去昨日最低的差值和0的较大值的3日S移动平均 */
        SMA_2 = Math.max(LOW - PRE_LOW, 0.0) * m / n + SMA_2 * (n - m) /n;
        VAR2 = SMA_2 == 0 ? VAR2 : SMA_1 / SMA_2 * 100;

        /* VAR2 * 10 的3日EMA均线 */
        EMA_1 = (VAR2 * 10) * 2 / (n + 1) + EMA_1 * (n - 1) / (n + 1);
        VAR3 = EMA_1;
        VAR3_arr[i] = VAR3;

        /* 38个周期内最大的VAR3数值 */
        VAR5 = 0;
        for (k = 0; k < 38; k++) {
            if (k > i) break;
            VAR5 = VAR3_arr[i - k] > VAR5 ? VAR3_arr[i - k] : VAR5;
        }

        let flag = 1;

        /* 最低价格是否小于等于38个周期内的最低价 */
        for (k = 1; k < 39; k++) {
            if (k > i) break;
            if (candlesticks[i - k][4] <= LOW) {
                flag = 0;
                break;
            }
        }   

        /* (VAR3 + VAR5 * 2) / 2 的3日EMA均线 */
        if (flag) {
            EMA_2 = (VAR3 / 2 + VAR5) * 2 / (n + 1) + EMA_2 * (n - 1) / (n + 1);
        } else {
            EMA_2 = EMA_2 * (n - 1) / (n + 1);
        }
        VAR7 = EMA_2 / 618;
        VAR7_arr[i] = VAR7; 
    }

    for (let i = 0; i < VAR7_arr.length; ++i) {
        VAR7_arr[i] = Math.round(VAR7_arr[i]);
    }

    return VAR7_arr;
}

// 月亮线
function monthLine(candlesticks)
{
    if (candlesticks.length < 1) return [];

    let i, k;
	const n = 13;
	const m = 8;
	const days = 21;
	let lowest = candlesticks[0][4];
	let lowest_index = 0;  //LLV(L,21)：21日内最低价的最低值
	let highest = candlesticks[0][3];
	let highest_index = 0;  //HHV(H,21)：21日内最高价的最高值
	let close = candlesticks[0][2];  //收盘价
	let VAR8 = Math.abs(highest - lowest) < 0.01 ? (close - lowest) / 0.005 * 100 : (close - lowest) / (highest - lowest) * 100;
	let VAR9 = VAR8;
    const length = candlesticks.length;
	month_line = new Array(candlesticks.slength).fill(0.0); 
    let count = 0;
    month_line[0] = VAR9;

	for (i = 1; i < candlesticks.size(); ++i) {
		if (candlesticks[i][4] < lowest) {
			lowest = candlesticks[i][4];  //LLV(L,21)：21日内最低价的最低值
			lowest_index = i;
		} else if (i - lowest_index + 1 > days) {
			// 重新计算LLV(L,21)
			lowest = candlesticks[i][4];
			lowest_index = i;
			for (k = 1; k < days; k++) {
				if (candlesticks[i - k].low < lowest) {
					lowest = candlesticks[i - k][4];
					lowest_index = i - k;
				}
			}
		}

		if (candlesticks[i][3] > highest) {
			highest = candlesticks[i][3];  //HHV(H,21)：21日内最高价的最高值
			highest_index = i;
		} else if (i - highest_index + 1 > days) {
			// 重新计算HHV(H,21)
			highest = candlesticks[i][3];
			highest_index = i;
			for (k = 1; k < days; k++) {
				if (candlesticks[i - k][3] > highest) {
					highest = candlesticks[i - k][3];
					highest_index = i - k;
				}
			}
		}

		close = candlesticks[i][2];  //收盘价

		VAR8 = Math.abs(highest - lowest) < 0.01 ? (close - lowest) / 0.05 * 100 : (close - lowest) / (highest - lowest) * 100;
		VAR9 = (VAR8 * m + VAR9 * (n - m)) / n;
		month_line[i] = VAR9;
	}
	for (i = month_line.size() - 1; i >= 0; --i) {
		month_line[i] = Math.round(month_line[i] * 100) / 100;
	}

	return month_line;
}

// 水平线
function horizon(candlesticks)
{
    if (candlesticks.length < 1) return [];
    
    let i, k;
    const n = 5;
    const m = 1;
    const days = 27;
    let lowest = candlesticks[0][4];
    let lowest_index = 0;  //LLV(L,27)：27日内最低价的最低值
    let highest = candlesticks[0][3];
    let highest_index = 0;  //HHV(H,27)：27日内最高价的最高值
    let close = candlesticks[0][2];  //收盘价

    /* 初始化：(收盘价-27日内最低价的最低值)/(27日内最高价的最高值-27日内最低价的最低值)*100 */
    let var1 = Math.abs(highest - lowest) < 0.01 ? (close - lowest) / 0.05 * 100 : (close - lowest) / (highest - lowest) * 100;

    /* 初始化：$var1的5日[1日权重]移动平均 */
    let SMA_1 = var1;

    /* 初始化：$SMA_1的3日[1日权重]移动平均 */
    let SMA_2 = SMA_1;

    /* 初始化：$var2 的5日简单移动平均 */
    let var2 = SMA_1 * 3 - SMA_2 * 2;
    let MA = var2;

    /* 保存 计算简单移动平均 */
    const length = candlesticks.length;
    let var2_arr = new Array(length).fill(0.0);
    var2_arr[0] = var2;

    /* 地平线 */
    let horizon = new Array(length).fill(0.0);
    horizon[0] = MA;

    for (i = 1; i < length; ++i) {
        if (candlesticks[i][4] < lowest) {
            lowest = candlesticks[i][4];  //LLV(L,27)：27日内最低价的最低值
            lowest_index = i;
        } else if (i - lowest_index + 1 > days) {
            // 重新计算LLV(L,27)
            lowest = candlesticks[i][4];
            lowest_index = i;
            for (k = 1; k < days; k++) {
                if (candlesticks[i - k][4] < lowest) {
                    lowest = candlesticks[i - k][4];
                    lowest_index = i - k;
                }
            }
        }

        if (candlesticks[i][3] > highest) {
            highest = candlesticks[i][3];  //HHV(H,27)：27日内最高价的最高值
            highest_index = i;
        } else if (i - highest_index + 1 > days) {
            // 重新计算HHV(H,27)
            highest = candlesticks[i][3];
            highest_index = i;
            for (k = 1; k < days; k++) {
                if (candlesticks[i - k][3] > highest) {
                    highest = candlesticks[i - k][3];
                    highest_index = i - k;
                }
            }
        }

        close = candlesticks[i][2];  //收盘价
        /* (收盘价-27日内最低价的最低值)/(27日内最高价的最高值-27日内最低价的最低值)*100 */
        var1 = Math.abs(highest - lowest) < 0.01 ? (close - lowest) / 0.05 * 100 : (close - lowest) / (highest - lowest) * 100;

        /* $var1的5日[1日权重]移动平均 */
        SMA_1 = (var1 * m + SMA_1 * (n - m)) / n;

        /* $SMA_1的3日[1日权重]移动平均 */
        SMA_2 = (SMA_1 * 1 + SMA_2 * (3 - 1)) / 3;

        /* $var2 的5日简单移动平均 */
        var2 = SMA_1 * 3 - SMA_2 * 2;
        var2_arr[i] = var2;

        let min_index = i + 1 < 5 ? i + 1 : 5;
        let MA = var2_arr[length - 1];
        for (k = 1; k < min_index; k++) {
            MA += var2_arr[i - k];
        }
        MA = MA / min_index;

        horizon[i] = MA;
    }

    for (i = horizon.size() - 1; i >= 0; --i) {
        horizon[i] = Math.round(horizon[i] * 100) / 100;
    }

    return horizon;
}
